	public Dictionary(int width, int height) {
		super(width, height);
	}
	
	public Dictionary() {
		super(80, sixteenByEighty);
	}
	
	/**
	 * Generates a dictionary matrix based on the given block dimensions
	 * @param dim The width/height of the square block
	 * @return Dictionary value
	 */
	private Matrix getDictionary(int dim) {
		int length = 2 * dim;
		double[] dxc = new double[dim*length];
		double[] dxs = new double[dim*length];
		
		for(int i = 0; i < dim; i++) {
			for(int k = 0; k < length; k++) {
				double fact;
				if(k == 0) {
					fact = Math.sqrt(2/length);
				} else {
					fact = 1/Math.sqrt(dim/2);
				}
				dxc[i*k+k] = fact * Math.cos(Math.PI*(2*i) * (k/(2*length)));
				System.out.println(dxc[i*k+k]);
				dxs[i*k+k] = fact * Math.sin(Math.PI*(2*i) * (k/(2*length)));
			}
		}
		
		double[] ex = new double[dim*dim];
		
		for(int i = 1; i < dim; i++){
			ex[i*i+i] = 1;
		}
		double[] dictionary = new double[dxc.length+dxs.length+ex.length];
		for(int i = 0; i < dxc.length; i++) {
			dictionary[i] = dxc[i];
		}
		for(int i = 0; i < dxs.length; i++) {
			dictionary[i+dxc.length] = dxs[i];
		}
		for(int i = 0; i < ex.length; i++) {
			dictionary[i+dxc.length+dxs.length] = ex[i];
		}
		return new Matrix(dim, dictionary);
	}

